import React from 'react';
import Button from 'react-bootstrap/Button';
import {FaDownload, FaTrashAlt} from 'react-icons/fa';
import '../App.css';


function OptionBtn(){
    return(
        <>
            <ButtonToolbar>
                <Button className="btn-circle" variant="outline-light"><FaDownload /></Button>
                <Button className="btn-circle" variant="outline-danger"><FaTrashAlt /></Button>
            </ButtonToolbar>
        </>
    );
}

export default OptionBtn;
